description:
Daring Meida proudly presents their new and promising director Diane Summers with her first innovating release Coming Out, capturing women in their most natural behaviour. In uncertainty about their sexual orientation these young women finally no longer conceal their sexual preference, and revealing their gender identity completely. No longer burdened by the opinions of their social environment they give themselves with no holds barred for the cameras. Nearly two hours of girl/girl eroticism!

Alexis Crystal, Morgan Blachette, El Storm, Alexis Crystal, Minnie, Nia Black, Minnie, Candy Sweet, Ria Rodriguez, Sandra

